    selectVPN(){
      $.ajaxSetup({async:false});
      const  myCharts = this.$echarts.init(this.$refs.myCharts,'dark');
      const  myCharts2 = this.$echarts.init(this.$refs.myCharts2,'dark');
      var terminalOn =
