      let nodeNewNum = 0;
      let defaultNum = this.option.series.length;
      let newLine = []
      let newLine2 = []
      let url = '/api/monitor/topology/logical',
        params = {
          vpnId: select1.value.split(' ')[0]
        }
      $.get(url, params, (res)=>{
        if(res.code == 0){
          //console.log(res.data)
          nodeNewNum = res.data.nodes.length
          for(let i=0;i<res.data.links.length;i++){
            let srcName = res.data.nodes[i].name
            let dstName = ''
            let dstId = res.data.links[i].destination['dest-node']
            if (dstId.substring(dstId.length-2) == 'L2'){
              dstName = this.mapping[dstId.substring(0,2)] + dstId.substring(dstId.length-2)
            }
            else{
              dstName = dstId
            }
            for(let j=0;j<this.nodes.length;j++){
              if(dstName == this.nodes[j].nodeName){
                let tempNode = {
                  nodeName: srcName,
                  value: [this.nodes[j].x, this.nodes[j].y-200],
                  symbolSize: [70,120],
                  symbolOffset:[0,'20%'],
                  symbol: terminalOn,
                  itemStyle: {
                    color: 'orange',
                  }
                }
                for(let k=0;k<this.charts.nodes.length;k++){
                  if((this.charts.nodes[k].value[0] == tempNode.value[0]) && (this.charts.nodes[k].value[1] == tempNode.value[1])){
                    this.charts.nodes[k].symbolOffset = [0,'1000%']
                  }
                }
                this.charts.nodes.push(tempNode)
                newLine.push({coords:[[this.nodes[j].x, this.nodes[j].y-200],[this.nodes[j].x, this.nodes[j].y]]})
              }
            }
          }
        }
      })

      let deviceName = ''
      let tunnelName = ''

      url = '/api/monitor/te/vpn/te-path',
        params = {
          vpnId: select1.value.split(' ')[0]
        }
      $.get(url, params, (res)=>{
        if(res.code == 0){
          if(res.data != []){
            for(let i=0;i<res.data.length;i++){
              let item = res.data[i]['te-policy-targets']
              deviceName = item['src-device']
              let srcL2Name = this.mapping[item['src-device'].substring(0,2)] +item['src-device'].substring(item['src-device'].length-2)
              let dstL2Name = this.mapping[item['dst-device'].substring(0,2)] +item['dst-device'].substring(item['dst-device'].length-2)
              for(let k=0;k<res.data[i]['te-tuples'].length;k++){
                item = res.data[i]['te-tuples'][k]
                let srcL1Name = this.mapping[item['src-device'].substring(0,2)] +item['src-device'].substring(item['src-device'].length-2)
                let dstL1Name = this.mapping[item['dst-device'].substring(0,2)] +item['dst-device'].substring(item['dst-device'].length-2)
                newLine.push([this.nodeMapping[srcL2Name],this.nodeMapping[srcL1Name]])
                newLine.push([this.nodeMapping[dstL1Name],this.nodeMapping[dstL2Name]])
                tunnelName = item['explicit-tunnel'][0]['tunnel-name']
                let primary = item['explicit-tunnel'][0]['te-path'][0]
                let j = 0
                for(j=0;j<primary['explicit-path'].length-1;j++){
                  let name1 = this.mapping[(primary['explicit-path'][j]['node-id'].substring(0,2))] + primary['explicit-path'][j]['node-id'].substring(primary['explicit-path'][j]['node-id'].length-2)
                  let name2 = this.mapping[(primary['explicit-path'][j+1]['node-id'].substring(0,2))] + primary['explicit-path'][j+1]['node-id'].substring(primary['explicit-path'][j+1]['node-id'].length-2)
                  newLine.push([this.nodeMapping[name1],this.nodeMapping[name2]])
                }
                let temp1 = primary['explicit-path'][j]['node-id']
                let temp2 = primary['dst-device']
                newLine.push([this.nodeMapping[this.mapping[temp1.substring(0,2)] + temp1.substring(temp1.length-2)],this.nodeMapping[this.mapping[temp2.substring(0,2)] + temp2.substring(temp2.length-2)]])

                if(item['explicit-tunnel'][0]['te-path'].length > 1){
                  let secondary = item['explicit-tunnel'][0]['te-path'][1]
                  newLine2.push([this.nodeMapping[srcL2Name],this.nodeMapping[srcL1Name]])
                  newLine2.push([this.nodeMapping[dstL1Name],this.nodeMapping[dstL2Name]])
                  for(j=0;j<secondary['explicit-path'].length-1;j++){
                    let name1 = this.mapping[(secondary['explicit-path'][j]['node-id'].substring(0,2))] + secondary['explicit-path'][j]['node-id'].substring(secondary['explicit-path'][j]['node-id'].length-2)
                    let name2 = this.mapping[(secondary['explicit-path'][j+1]['node-id'].substring(0,2))] + secondary['explicit-path'][j+1]['node-id'].substring(secondary['explicit-path'][j+1]['node-id'].length-2)
                    newLine2.push([this.nodeMapping[name1],this.nodeMapping[name2]])
                  }
                  temp1 = secondary['explicit-path'][j]['node-id']
                  temp2 = secondary['dst-device']
                  newLine2.push([this.nodeMapping[this.mapping[temp1.substring(0,2)] + temp1.substring(temp1.length-2)],this.nodeMapping[this.mapping[temp2.substring(0,2)] + temp2.substring(temp2.length-2)]])
                }
              }
            }
          }
        }
      })

      var teFlowInData = []
      var teFlowDate = []

      url = 'api/monitor/te/history',
        params = {
          namespace: "traffic",
          metricNames: "in_traffic",
          "dimensions.0.name": "deviceName",
          "dimensions.0.value": deviceName,
          "dimensions.1.name": "tunnelName",
          "dimensions.1.value": tunnelName,
          period: '1h'
        }
      $.get(url, params, (res)=>{
        if(res.code == 0){
          for(let i=0;i<res.data.length;i++){
            teFlowDate.push(res.data[i].time.substring(11,16))
            teFlowInData.push(res.data[i].in_traffic)
          }
