      var vpnFlowInData = []
      var vpnFlowOutData = []
      var vpnFlowDate = []

      url = '/api/monitor/vpn/history',
         params = {
          namespace: "traffic",
          metricNames: "in_traffic, out_traffic",
          "dimensions.0.name": select1.value,
          "dimensions.0.value": select1.value,
